      SELECT + COUNT ( * ) * + - 48 AS col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1 WHERE - 6 <> + 93;
  - name: tab1

outputs:
